import React from 'react';

import './App.css';

// components 
import { HorizontalNav } from './components/horizontalNav/HorizontalNav';
import { VerticalNav } from './components/verticalNav/VerticalNav';

import { Dashboard } from './components/dashboard/Dashboard';

function App() {
  return (
    <>
      <HorizontalNav />
      <VerticalNav />
      <Dashboard />
    </>
  );
}

export default App;
